@Rhardd @tailwindcss @Apply @sveltejs Yeah, I can't deny it looks messy because it does 😂.

One developer experience I want is a way to automatically sort / group class names so developers don't have to search the entire class="" string during development.

Need to search for that again soon.

@Rhardd @tailwindcss @Apply @sveltejs 100% agree. We have to get rid of thousands of lines of custom CSS code first :(.

Once that's gone, we'll create a UI component library and will apply these kind of abstractions.

This will match with a Figma component library so designers &amp; devs talk the same language.

@dcblogdev @tailwindcss @simonswiss That’s great to hear.

It looked pretty straight forward in the video.

I’m looking forward to the JIT compiler… did you find it works smoothly in Laravel?

To setup tailwind CSS run these commands,

1. npm init -y
// This initializes the directory as a NodeJS project

2. npm install -D tailwindcss postcss autoprefixer vite
// This installs required packages

3. npx tailwindcss init -p

