@danielcranney @tailwindcss It really is! 🙌

I will admit, I went with a bit of a "so let's see what everyone is going on about" attitude. 

But, I can now definitely see why people love it. Once you get the hang of its syntax, it's really quick and easy to use. 😊

@danielcranney @tailwindcss Definitely! I haven't expanded it to much just yet. Only for some extra colours and fonts. 

I really likd the base sizes and viewports they have. 

I just now need to get into the habit of mobile first development 😅

@coppnic @tailwindcss @figmadesign Macht einen guten ersten Eindruck. @DeedoDev will es gerne für Freigeist nutzen.

Für mich macht der utility Klassen Ansatz Sinn. Ist auf Art auch näher an wie Designer über Designsysteme nachdenken, als semantische css Klassen.

Für mich ist die große Frage, wie man tailwind…

@webdev_jr Nope, i’m quite bad in design 🥲

I usually follow mock-ups or real examples to realize something 😂

But i’m pretty good with @tailwindcss ✈️

@mabdullahsari I am aware, I saw those very tweets and already read https://t.co/hfvG0M0k2a

I would like to point out that it just makes some stuff (like this transition) easier! 

I can always go back and make new partials, but it’s a great stopgap measure to migrate away from legacy CSS.

@danielcranney @tailwindcss NGL, Tailwind made me develop it mobile-first as their breakpoints are designed that way 😅

I actually made this sidebar desktop-first then noticed their breakpoints and had "Oh crap" moment 😂

And, that's how I do it as well. Design desktop first, then adapt it for mobile.

